def encrypt(s):
    alphabet = 'abcdefghijklmnopqrstuvwxyz'
    encrypted = ''
    for char in s:
        if char in alphabet:
            index = (alphabet.index(char) + 2 * 2) % 26
            encrypted += alphabet[index]
        else:
            encrypted += char
    return encrypted

def encode(message):
