def intersection(interval1, interval2):
    start = max(interval1[0], interval2[0])
    end = min(interval1[1], interval2[1])
    if start > end:
        return "NO"
    length = end - start + 1
    if length == 1:
        return "NO"
    for i in range(2, int(length**0.5) + 1):
        if length % i == 0:
            return "NO"
    return "YES"

def tri(n):
    if n == 0:
        return [3]
    elif n == 1:
        return [3, 1]
    elif n == 2:
        return [3, 1, 2]
    else:
        sequence = [3, 1, 2]
        for i in range(3, n + 1):
            if i % 2 == 0:
                sequence.append(sequence[-1] + sequence[-2] + sequence[-3])
            else:
                sequence.append(sequence[-1] + sequence[-2] + sequence[-3] + 1)
        return sequence

